llm_output:
function transfer(address recipient, uint256 amount) public {
    require(recipient != address(0), "ERC20: transfer to the zero address");
    require(amount > 0, "ERC20: transfer amount must be greater than zero");
    require(balanceOf(msg.sender) >= amount, "ERC20: transfer amount exceeds balance");

    // Check if transfer delay is enabled
    if (transferDelayEnabled) {
        require(block.number > _lastTransferBlock[msg.sender], "_transfer: Transfer Delay enabled. Only one purchase per block allowed.");
        _lastTransferBlock[msg.sender] = block.number;
    }

    // Check transaction limits
    if (limitsInEffect) {
        if (!isExcludedFromMaxTransactionAmount[msg.sender] && !isExcludedFromMaxTransactionAmount[recipient]) {
            require(amount <= maxTransactionAmount, "Transfer amount exceeds the maxTransactionAmount.");
        }
        if (!isExcludedFromMaxTransactionAmount[recipient]) {
            require(balanceOf(recipient) + amount <= maxWallet, "Recipient wallet exceeds the maxWallet size.");
        }
    }

    // Perform the transfer
    _balances[msg.sender] -= amount;
    _balances[recipient] += amount;

    emit Transfer(msg.sender, recipient, amount);
}

